import Mainpage from "./Mainpage/Mainpage/Mainpage";
import Sidebar from "./Sidebar/Sidebar/Sidebar";
import Footer from "./Footer";
import app_styles from "./app.module.scss";
import { HashRouter, Route, Routes } from "react-router-dom";

import UseState from "../Hooks/UseState/UseState";
import UseRef from "../Hooks/UseRef/UseRef";
import UseReducer from "../Hooks/UseReducer/UseReducer";
import UseEffect from "../Hooks/UseEffect/UseEffect";
import UseContext from "../Hooks/UseContext/UseContext";
import UseMemo from "../Hooks/UseMemo/UseMemo";
import UseCallback from "../Hooks/UseCallback/UseCallback";

import Clsx from "../Packages/Clsx/Clsx";
import Eslint from "../Packages/Eslint/Eslint";
import Git_embed from "../Packages/Git_embed/Git_embed";
import I18n from "../Packages/I18n/I18n";
import Material_UI from "../Packages/Material_UI/Material_UI";
import Pug from "../Packages/Pug/Pug";
import React_Router from "../Packages/React_Router/React_Router";
import Redux from "../Packages/Redux/Redux";
import Sass from "../Packages/Sass/Sass.js";

const Router = () => (
  <Routes>
    <Route path="/introduce" element={<UseState />} />
    {/* <Route path="/" element={<React_intro />} /> */}
  </Routes>
);

function App() {
  return (
    <div className="App">
      <div className={app_styles.layout1}>
        <Sidebar />
        <Mainpage />
      </div>
      <div className={app_styles.layout2}>
        <Footer />
      </div>

      <HashRouter>
        <Router />
      </HashRouter>
    </div>
  );
}

export default App;
